'toolkit/chrome/global/aboutRights.dtd:rights.webservices-term4' => 'Izinsizakalo zinikelwa &#34;nje-nge.&#34;  &amp;vendorShortName;, abanikeli, izikhungo ezinikezela ngelayisense nabasabalalisi bayo bakhipha zonke iziqinisekiso, zigcizelela noma ziqondisiwe, kufaka phakathi ngaphandle komkhawulo, iziqinisekiso ukuba izinsizakalo ziyathengiswa futhi zifanele izinhloso sakho ezithile.  Uvemelana nayo yonke ingozi ngokukhetha izinsizakalo zezinhloso zakho futhi njengakukhwalithi nokusebenza kwezinsizakalo. Ezinye izindawo ethile azivumeli ukukhishwa noma ukukhawulelwa kweziqiniseko ezicatshangelwe, ngakho-ke lo mshwana wokuzikhipha emthwalweni kungenzeka ungasebenzi kuwe.',
'toolkit/chrome/global/aboutRights.dtd:rights.webservices-term5' => 'Ngaphandle kokuba kudingeke ngokomthetho, i-&amp;vendorShortName;, abanikeli, izikhungo ezinikezela ngelayisense, nabasabalalisi bayo ngeke baphoqeleka ngokomthetho kokunye nokunye okungaqondene, okukhethekile, okwenzeka kungahleliwe, okungagudluki, okujezisayo noma amacala wokungagudluki angenayo naphumayo nganoma iyiphi indlela ehlobene nokusetshenziswa kwe-&amp;brandShortName; nezonsizakalo.  Iqoqo lesibopho sezomthetho ngaphansi kwaleyo migomo ngeke lidlule ku-$500 (amadola angamakhulu amahlanu). Ezinye izindawo ethile azivumeli ukukhishwa noma ukukhawulelwa kweziqiniseko ezicatshangelwe, ngakho-ke lo mshwana wokuzikhipha emthwalweni kungenzeka ungasebenzi kuwe.',
